import {
  all,
  fork,
  call,
  take,
  put,
  takeEvery,
  takeLatest,
  delay,
} from "redux-saga/effects";
import axios from "axios";
import postSaga from "./post";
import userSaga from "./user";
export default function* rootSaga() {
  yield all([fork(postSaga), fork(watchLogOut), fork(watchAddPost)]);
}
